.0\" encoding=\"UTF-8\"?>\r\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\r\n	xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\r\n	xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\r\n	xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\r\n	expressionLanguage=\"http://www.w3.org/1999/XPath\" targetNamespace=\"http://www.rguess.org/demo/activiti/leave\">\r\n	<process id=\"leave\" name=\"请假流程\">\r\n		<documentation>请假流程演示</documentation>\r\n		<startEvent id=\"startevent1\" name=\"Start\"\r\n			activiti:initiator=\"applyUserId\"></startEvent>\r\n		<userTask id=\"deptLeaderAudit\" name=\"部门领导审批\"\r\n			activiti:candidateGroups=\"deptLeader\"></userTask>\r\n		<exclusiveGateway id=\"exclusivegateway5\" name=\"Exclusive Gateway\"></exclusiveGateway>\r\n		<userTask id=\"modifyApply\" name=\"调整申请\" activiti:assignee=\"${applyUserId}\">\r\n			<extensionElements>\r\n				<activiti:taskListener event=\"complete\"\r\n					delegateExpression=\"${afterModifyApplyContentProcessor}\"></activiti:taskListener>\r\n			</extensionElements>\r\n		</userTask>\r\n		<userTask id=\"hrAudit\" name=\"人事审批\" activiti:candidateGroups=\"hr\"></userTask>\r\n		<exclusiveGateway id=\"exclusivegateway6\" name=\"Exclusive Gateway\"></exclusiveGateway>\r\n		<userTask id=\"reportBack\" name=\"销假\" activiti:assignee=\"${applyUserId}\">\r\n			<extensionElements>\r\n				<activiti:taskListener event=\"complete\"\r\n					delegateExpression=\"${reportBackEndProcessor}\"></activiti:taskListener>\r\n			</extensionElements>\r\n		</userTask>\r\n		<endEvent id=\"endevent1\" name=\"End\"></endEvent>\r\n		<exclusiveGateway id=\"exclusivegateway7\" name=\"Exclusive Gateway\"></exclusiveGateway>\r\n		<sequenceFlow id=\"flow2\" name=\"\" sourceRef=\"startevent1\"\r\n			targetRef=\"deptLeaderAudit\"></sequenceFlow>\r\n		<sequenceFlow id=\"flow3\" name=\"\" sourceRef=\"deptLeaderAudit\"\r\n			targetRef=\"exclusivegateway5\"></sequenceFlow>\r\n		<sequenceFlow id=\"flow4\" name=\"不同意\" sourceRef=\"exclusivegateway5\"\r\n			targetRef=\"modifyApply\">\r\n			<conditionExpression xsi:type=\"tFormalExpression\"><![CDATA[${!deptLeaderPass}]]></conditionExpression>\r\n		</sequenceFlow>\r\n		<sequenceFlow id=\"flow5\" name=\"同意\" sourceRef=\"exclusivegateway5\"\r\n			targetRef=\"hrAudit\">\r\n			<conditionExpression xsi:type=\"tFormalExpression\"><![CDATA[${deptLeaderPass}]]></conditionExpression>\r\n		</sequenceFlow>\r\n		<sequenceFlow id=\"flow6\" name=\"\" sourceRef=\"hrAudit\"\r\n			targetRef=\"exclusivegateway6\"></sequenceFlow>\r\n		<sequenceFlow id=\"flow7\" name=\"同意\" sourceRef=\"exclusivegateway6\"\r\n			targetRef=\"reportBack\">\r\n			<conditionExpression xsi:type=\"tFormalExpression\"><![CDATA[${hrPass}]]></conditionExpression>\r\n		</sequenceFlow>\r\n		<sequenceFlow id=\"flow8\" name=\"\" sourceRef=\"reportBack\"\r\n			targetRef=\"endevent1\"></sequenceFlow>\r\n		<sequenceFlow id=\"flow9\" name=\"不同意\" sourceRef=\"exclusivegateway6\"\r\n			targetRef=\"modifyApply\">\r\n			<conditionExpression xsi:type=\"tFormalExpression\"><![CDATA[${!hrPass}]]></conditionExpression>\r\n		</sequenceFlow>\r\n		<sequenceFlow id=\"flow10\" name=\"重新申请\" sourceRef=\"exclusivegateway7\"\r\n			targetRef=\"deptLeaderAudit\">\r\n			<conditionExpression xsi:type=\"tFormalExpression\"><![CDATA[${reApply}]]></conditionExpression>\r\n		</sequenceFlow>\r\n		<sequenceFlow id=\"flow11\" name=\"\" sourceRef=\"modifyApply\"\r\n			targetRef=\"exclusivegateway7\"></sequenceFlow>\r\n		<sequenceFlow id=\"flow12\" name=\"结束流程\" sourceRef=\"exclusivegateway7\"\r\n			targetRef=\"endevent1\">\r\n			<conditionExpression xsi:type=\"tFormalExpression\"><![CDATA[${!reApply}]]></conditionExpression>\r\n		</sequenceFlow>\r\n	</process>\r\n	<bpmndi:BPMNDiagram id=\"BPMNDiagram_leave\">\r\n		<bpmndi:BPMNPlane bpmnElement=\"leave\" id=\"BPMNPlane